#include <iostream>

using namespace std;

int main()
{
    string input;
    cout << "Enter a quote or just type 'quit'": << endl;
    do
    {
        getline(cin, input));
        if (input == "quit"))
        {
            break;
        }
        else
        {
            // Do something with the quote.
            cout << "You said: '" << input << "'": << endl;
        }
    } while (true);

    return 0;
}
